1. Guiding Principle: Abstracting Complexity via Tiered Abstractions The core philosophy is to provide programmers with abstractions that match the structure of their problem, while hiding the complex, error-prone mechanics of the underlying hardware. The language will offer a tiered set of tools, from simple "it just works" parallelism for common cases to expert-level control for specialized needs. The default path will always be the safest and most abstract. 2. Tier 1: Foundational CPU Parallelism - The Work-Stealing Scheduler This is the engine that will power most CPU-bound parallel operations. Its implementation is internal to the language runtime and not directly exposed to the programmer. Application: General-purpose CPU-bound tasks, fork-join parallelism, parallel loops. Implementation Strategy: Per-Core Deques: On startup, the runtime creates a pool of worker threads, pinning each to a physical CPU core. Each thread is assigned a double-ended queue (deque). LIFO/FIFO Discipline: A worker thread pushes new sub-tasks (fork) and pops its own work (join) from the bottom of its deque (LIFO). This is a private, non-atomic, cache-friendly operation. When a worker runs out of local work, it becomes a "thief" and attempts to pop a task from the top of another randomly chosen worker's deque (FIFO). Lock-Free Stealing: The "steal" operation on the top of the deque must be implemented using a lock-free algorithm, relying on a hardware-level Compare-And-Swap (CAS) atomic instruction to safely manage the head pointer in the face of concurrent thieves. Global Injection Queue: A single, global, concurrent Multi-Producer/Multi-Consumer (MPMC) queue will exist for submitting initial work from outside the thread pool (e.g., from the main thread or an I/O thread). Workers will check this queue before attempting to steal. 3. Tier 2: High-Level Parallel Constructs (The Programmer's Interface) These are the primary tools programmers will use. They are built on top of the Tier 1 scheduler. 3.1. Embarrassingly Parallel Operations Application: Image processing, scientific computing, data transformation, any problem that can be modeled as "do the same thing to every element in a collection." Feature: Parallel Iterators Interface (Pseudocode): // A standard collection type
interface Collection<T> { // Returns a standard sequential iterator iter(): Iterator<T> // Returns a parallel iterator, the gateway to parallelism par_iter(): ParallelIterator<T>
} interface ParallelIterator<T> { // Executes a function for each element in parallel. // Blocks until all work is complete. for_each(func: (T) -> void): void // Creates a new parallel collection by applying a function to each element. map<U>(func: (T) -> U): ParallelCollection<U> // Reduces the collection to a single value in parallel. reduce(identity: T, op: (T, T) -> T): T
} Implementation Strategy: A call to par_iter().for_each(...) is not a simple loop. The implementation recursively splits the collection's range in half. When a range is large enough, it forks the processing of one half as a new task onto the current worker's deque and recursively processes the other half itself. This naturally feeds the work-stealing scheduler. 3.2. Complex Dependency Graphs Application: Compilers, build systems, game engines, any workflow with irregular, dynamic dependencies. Feature: Futures and Asynchronous Tasks Interface (Pseudocode): // A Future is a handle to a value that may not be ready yet.
interface Future<T> { // Blocks the current *logical task* (not thread) until the value is ready. // A worker thread that awaits will drop this task and steal another. await(): T // Checks if the value is ready without blocking. is_ready(): bool
} // The core scheduler interface for dependent tasks.
interface Scheduler { // Schedules a function to run. Returns a Future to its result immediately. // The task becomes runnable as soon as its dependencies are met. schedule<T>( task_func: () -> T, dependencies: optional Collection<Future<any>> ): Future<T>
} Implementation Strategy: The Scheduler.schedule function creates a Task object containing the function pointer and a list of dependency Futures. The Task is placed in a central graph and marked Waiting. When a Future is completed, the scheduler iterates through its dependents. If a dependent Task has all its dependencies met, its state is changed to Runnable and it's pushed to the global injection queue. A call to Future.await() within a task's logic is a compiler/runtime intrinsic. It registers the current task as Waiting on the target Future and signals the worker thread to immediately return to the scheduler to find a new Runnable task. It must not block the OS thread. 4. Tier 3: Heterogeneous & Distributed Computing This tier acknowledges that not all hardware is the same and that computation may span multiple machines. It builds on the concepts of Tiers 1 and 2 but adapts them for different constraints. 4.1. GPU Co-Processing Application: Highly data-parallel sub-problems within a larger computation (e.g., specific compiler passes, linear algebra, image filtering). Feature: Execution Policies and Kernel Abstraction Interface (Pseudocode): // Extend parallel iterators with an execution policy.
// The programmer hints at the desired execution environment.
enum ExecutionPolicy { CPU, GPU_ACCELERATED } interface ParallelIterator<T> { // New `for_each` with a policy. for_each(policy: ExecutionPolicy, func: (T) -> void): void
} Implementation Strategy: When ExecutionPolicy.GPU_ACCELERATED is used, the runtime attempts to compile the body of the func lambda into a GPU kernel (e.g., SPIR-V or PTX). It inserts boilerplate code to manage memory transfers: CPU RAM -> GPU VRAM, kernel execution, and GPU VRAM -> CPU RAM. This is a "leaky abstraction": the programmer is responsible for ensuring the func body is GPU-friendly (no divergent control flow, etc.) and that the data size justifies the transfer overhead. Indirect Execution: For advanced cases (like game engines), provide IndirectDraw commands that allow the CPU to tell the GPU to chain its own operations without CPU readback, using GPU-side buffers as command arguments. 4.2. Distributed Tasks Application: Big data processing (e.g., Apache Spark), large-scale scientific simulations. Feature: Resilient Distributed Datasets/DataFrames and Remote Tasks Interface (Pseudocode): // Abstraction for a collection partitioned across a cluster.
interface DistributedCollection<T> { // Transformations build a lineage graph but don't execute yet (lazy). map<U>(func: (T) -> U): DistributedCollection<U> filter(func: (T) -> bool): DistributedCollection<T> // Actions trigger the actual computation across the cluster. reduce(op: (T, T) -> T): Future<T> collect(): Future<Collection<T>>
} // All functions passed to transformations must be serializable.
// The language must provide a `Serializable` trait/interface. Implementation Strategy: Lazy Evaluation & Lineage: Calls to map and filter do not execute. They build a logical Directed Acyclic Graph (DAG) of the computation's "lineage". Job Scheduler: A call to an action (reduce, collect) triggers the central scheduler. It analyzes the DAG, optimizes it, and breaks it into stages of coarse-grained, serializable tasks. Data Locality: The scheduler queries a cluster manager to find where data partitions live and attempts to send computation to the data. Fault Tolerance: If a worker node dies, the scheduler uses the lineage graph to re-compute the lost data partitions by re-running the necessary tasks on another available node. RPC & Serialization: The runtime must have a robust, built-in RPC mechanism and a default serialization protocol. 5. Conclusion: A Graduated Approach to Parallelism By structuring the language features in these tiers, we empower all levels of programmers. Novices can achieve significant speedups safely with par_iter. Experts can build complex, real-time systems like game engines using the Future-based tasking system. And data scientists can scale their analyses to massive clusters, all while thinking in terms of the same core concept: a graph of dependent computations. The language's role is to provide the safest, most abstract tool that can effectively solve the problem at hand.
